urces to get you back on track.%4$s'=>'%1$sCzasami rzeczy po prostu nie działają zgodnie z oczekiwaniami. %2$strona rozwiązywania problemów%3$s zawiera mnóstwo zasobów, które pomogą Ci wrócić na właściwe tory.%4$s','%1$sThe Events Calendar comes with a default API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %2$sGoogle Maps API key%3$s.%4$s'=>'%1$sKalendarz wydarzeń jest dostarczany z domyślnym kluczem API dla podstawowej funkcjonalności map. Jeśli chcesz korzystać z bardziej zaawansowanych funkcji, takich jak niestandardowe znaczniki mapy lub dynamiczne ładowanie map, musisz uzyskać własny %2$sklucz API Map Google%3$s.%4$s','Getting started guide'=>'Przewodnik wprowadzający','If you’re enjoying The Events Calendar, give us kudos by including a link in the footer of calendar views. It really helps us a lot.'=>'Jeśli podoba Ci się The Events Calendar, pochwal nas, umieszczając link w stopce widoków kalendarza. To naprawdę bardzo nam pomaga.','There is a solution for every problem'=>'Na każdy problem jest rozwiązanie','Label for the Summary View checkbox.Summary'=>'Streszczenie','Text for link to the add-ons page.Check out the available add-ons.'=>'Sprawdź dostępne dodatki.','Import events with Event Aggregator'=>'Importuj zdarzenia za pomocą Agregatora wydarzeń','Title for the editing section of the general settings.Editing'=>'Edytowanie','Title for the viewing section of the general settings.Viewing'=>'Przeglądanie','Advanced Google Maps functionality'=>'Zaawansowana funkcjonalność Map Google','Default Styles'=>'Style domyślne','Enter the format to use for displaying dates with the year. Used when showing an event from a future year. Example: %1$s'=>'Wprowadź format, który ma być używany do wyświetlania dat z rokiem. Używany podczas wyświetlania wydarzenia z przyszłego roku. Przykład: %1$s','Get Event Tickets to manage attendee registration and ticket sales to