ce? You can find more information here:'=>'Potrzebujesz pomocy? Więcej informacji znajdziesz tutaj:','Importing Calendar Data From a CSV File'=>'Import danych kalendarza z pliku CSV','CSV File Formatting and Examples '=>'Formatowanie pliku CSV i przykłady ','Download report'=>'Pobierz raport','Migration attempted'=>'Próba migracji','Migration reversed'=>'Migracja odwrócona','Ticket sales and RSVPs will be paused until migration is complete.'=>'Sprzedaż biletów i potwierdzenia uczestnictwa zostaną wstrzymane do czasu zakończenia migracji.','Ticket sales, RSVPs, and automatic imports will be paused until migration is complete.'=>'Sprzedaż biletów, potwierdzenia uczestnictwa i automatyczne importy zostaną wstrzymane do czasu zakończenia migracji.','Ticket sales, RSVPs, and event submissions will be paused until migration is complete.'=>'Sprzedaż biletów, potwierdzenia uczestnictwa i zgłoszenia wydarzeń zostaną wstrzymane do czasu zakończenia migracji.','Ticket sales, RSVPs, event submissions, and automatic imports will be paused until migration is complete.'=>'Sprzedaż biletów, potwierdzenia obecności, przesyłanie zgłoszeń na wydarzenia oraz automatyczne importowanie zostaną wstrzymane do czasu zakończenia migracji.','Your site could not be safely migrated to the new events system.'=>'Nie udało się bezpiecznie przenieść Twojej witryny do nowego systemu wydarzeń.','Automatic imports will be paused until migration is complete.'=>'Automatyczny import zostanie wstrzymany do czasu zakończenia migracji.','Event submissions and automatic imports will be paused until migration is complete.'=>'Przesyłanie zdarzeń i automatyczny import zostaną wstrzymane do czasu zakończenia migracji.','Event submissions will be paused until migration is complete.'=>'Przesyłanie zdarzeń zostanie wstrzymane do czasu zakończenia migracji.','Migration failed'=>'Migracja nieudana','Migration failure'=>'Migracja zakończona niepowodzeniem','Okay'=>'Dobrze','One more thing left to do...'=>'Została jeszcze jedna rzecz do zrobienia...','To complete this major calendar upgrade, you need to migrate your events to the new data storage system. Once migration finishes, you can take advantage of all the cool new 6.0 features!'=>'Aby zakończyć tę dużą aktualizację kalendarza, musisz zmigrować swoje wydarzenia do nowego systemu przechowywania danych. Po zakończeniu migracji możesz korzystać ze wszystkich fajnych nowych funkcji 6.0!','View the error report'=>'Zobacz raport błędów','We detected an event that cannot be properly migrated. Please review the report below for more information. This issue must be resolved before you can migrate your site. Once you have updated or removed the problematic event, re-run the migration preview to make sure your site is ready to go.'=>'Wykryliśmy zdarzenie, które nie może być prawidłowo zmigrowane. Przejrzyj poniższy raport, aby uzyskać więcej informacji. Ten problem musi zostać rozwiązany przed migracją witryny. Po zaktualizowaniu lub usunięciu problematycznego zdarzenia, ponownie uruchom podgląd migracji, aby upewnić się, że Twoja witryna jest gotowa do pracy.','The Events Calendar: Custom Tables v1 - error'=>'Kalendarz wydarzeń: Tabele niestandardowe v1 - błąd','Cancel Migration'=>'Anuluj migrację','Cancelation in progress'=>'Anulowanie w toku','Cancelation complete.'=>'Anulowanie zakończone.','Cancel Migration Preview'=>'Anuluj podgląd migracji','Events can migrate with no changes!'=>'Wydarzenia mogą być migrowane bez żadnych zmian!','Migration help'=>'Pomoc w migracji','Reverse migration'=>'Migracja odwrotna','Reverse migration complete.'=>'Migracja odwrotna zakończona.','Reverse migration in progress'=>'Trwa migracja odwrotna','The event %s cannot be migrated because we do not yet support tickets on recurring events. Remove the tickets or wait to migrate until a path is available (%sRead more%s).'=>'Wydarzenie %s nie może zostać zmigrowane, ponieważ nie obsługujemy jeszcze biletów na wydarzenia cykliczne. Usuń bilety lub poczekaj na migrację, aż ścieżka będzie dostępna (%sCzytaj więcej%s).','The event %s generated an error: Cannot enqueue action to check migration status. Your site may be under high load and unable to process the necessary requests. Try again when site activity is low.'=>'Zdarzenie %s wygenerowało błąd: Nie można dodać akcji do kolejki w celu sprawdzenia statusu migracji. Twoja witryna może być obciążona i nie może przetworzyć wymaganych żądań. Spróbuj ponownie, gdy aktywność witryny będzie niska.','The event %s generated an error: Cannot enqueue action to migrate Event with post ID %s. Your site may be under high load and unable to process the necessary requests. Try again later.'=>'Wydarzenie %s wygenerowało błąd: Nie można umieścić akcji w kolejce, aby migrować wydarzenie o identyfikatorze posta %s. Twoja witryna może być mocno obciążona i nie może przetworzyć wymaganych żądań. Spróbuj ponownie później.','The event %s generated an error: Migration was canceled. Please try again.'=>'Wydarzenie %s wygenerowało błąd: Migracja została anulowana. Spróbuj ponownie.','The event %s generated an error: [%s]. Please try again or check out our %sTroubleshooting%s tips.'=>'Wydarzenie %s wygenerowało błąd: [%s]. Spróbuj ponownie lub sprawdź nasze wskazówki %sTroubleshooting%s.','The event %s generated an unknown error. Please try again or check out our %sTroubleshooting%s tips.'=>'Wydarzenie %s wygenerowało nieznany błąd. Spróbuj ponownie lub sprawdź nasze wskazówki %sTroubleshooting%s.','The following %1$s will be migrated with no adjustments:'=>'Następujące %1$s zostaną zmigrowane bez żadnych zmian:','Total events migrated:'=>'Łączna liczba przeniesionych zdarzeń:','Unknown strategy applied to this event.'=>'Nieznana strategia zastosowana do tego zdarzenia.','We are canceling your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Anulujemy migrację Twojej witryny do nowego systemu. W tym czasie %1$snie możesz tworzyć, edytować ani zarządzać swoimi wydarzeniami%2$s. Twój kalendarz nadal będzie widoczny w witrynie, ale niektóre działania front-endu zostaną wstrzymane.','We are reversing your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Cofamy migrację Twojej witryny do nowego systemu. W tym czasie %1$snie możesz tworzyć, edytować ani zarządzać swoimi wydarzeniami%2$s. Twój kalendarz nadal będzie widoczny w witrynie, ale niektóre działania front-endu zostaną wstrzymane.','We detected one or more events that cannot be properly migrated. Please review the report below for more information. These issues must be resolved before you can migrate your site. Once you have updated or removed problematic events, please re-run the migration preview.'=>'Wykryliśmy jedno lub więcej zdarzeń, których nie można poprawnie zmigrować. Aby uzyskać więcej informacji, zapoznaj się z poniższym raportem. Te problemy muszą zostać rozwiązane, zanim będziesz mógł zmigrować swoją witrynę. Po zaktualizowaniu lub usunięciu problematycznych zdarzeń uruchom ponownie podgląd migracji.','Your events are being migrated to the new system. During migration, %1$syou cannot make changes to your calendar or events.%2$s Your calendar will still be visible on the frontend.'=>'Twoje wydarzenia są migrowane do nowego systemu. Podczas migracji %1$snie możesz wprowadzać zmian w kalendarzu ani wydarzeniach.%2$s Twój kalendarz nadal będzie widoczny w interfejsie użytkownika.','Your site is now using the upgraded event data storage system. Go ahead and %1$scheck out your events%2$s or %3$sview your calendar.%2$s'=>'Twoja witryna korzysta teraz z ulepszonego systemu przechowywania danych zdarzeń. Przejdź dalej i %1$ssprawdź swoje zdarzenia%2$s lub %3$swyświetl swój kalendarz.%2$s','Number of events awaiting migration%1$s%2$d%3$s remaining'=>'Pozostało %1$s%2$d%3$s','Number of events awaiting preview%1$s%2$d%3$s remaining'=>'Pozostało %1$s%2$d%3$s','Number of events migrated%1$s%2$d%3$s events migrated'=>'Zmigrowano %1$s%2$d%3$s zdarzeń','Number of events previewed%1$s%2$d%3$s events previewed'=>'Wyświetlono podgląd %1$s%2$d%3$s wydarzeń','Migration canceled'=>'Anulowano migrację','Migration complete!'=>'Migracja zakończona!','Migration completed'=>'Migracja zakończona','Retry'=>'Ponów','View the migration report'=>'Zobacz raport migracji','The following %1$s have been migrated with no adjustments:'=>'Następujące %1$s zostały zmigrowane bez żadnych zmian:','The event %s generated an error: The "die" or "exit" function was called during the migration process; output: %s. Please try again or check out our %sTroubleshooting%s tips.'=>'Wydarzenie %s wygenerowało błąd: Funkcja „die” lub „exit” została wywołana podczas procesu migracji; dane wyjściowe: %s. Spróbuj ponownie lub zapoznaj się z naszymi wskazówkami dotyczącymi %sTroubleshooting%s.','The event %s generated an error: [%s]. Update the event and try again, or check out our %sTroubleshooting%s tips.'=>'Wydarzenie %s wygenerowało błąd: [%s]. Zaktualizuj wydarzenie i spróbuj ponownie lub sprawdź nasze wskazówki dotyczące %sTroubleshooting%s.','Start migration'=>'Rozpocznij migrację','Migration in progress'=>'Migracja w toku','Learn more about the migration'=>'Dowiedz się więcej o migracji','https://evnt.is/1b79'=>'https://evnt.is/1b79','(Estimated time: %1$s minutes)'=>'(Szacowany czas: %1$s minut)','(Estimated time: %1$s minute)'=>'(Szacowany czas: %1$s minuta)','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Na podstawie tego podglądu szacujemy, że pełny proces migracji zajmie około %3$d minut. W tym czasie %1$snie będziesz w stanie tworzyć, edytować ani zarządzać swoimi wydarzeniami.%2$s Twój kalendarz nadal będzie widoczny w Twojej witrynie.','Migration preview in progress'=>'Podgląd migracji w toku','Preview complete'=>'Podgląd ukończony','Preview completed'=>'Podgląd ukończony','Ready to go? The first step is a migration preview.'=>'Gotowy do drogi? Pierwszym krokiem jest podgląd migracji.','Start migration preview'=>'Rozpocznij podgląd migracji','Total events previewed:'=>'Łączna liczba wydarzeń, które zostały zaprezentowane:','We\'ll scan your events and let you know how long your migration will take. The preview runs in the background, so you\'ll be able to continue using your site.'=>'Przeskanujemy Twoje wydarzenia i poinformujemy Cię, ile czasu zajmie migracja. Podgląd działa w tle, więc będziesz mógł nadal korzystać ze swojej witryny.','We\'re scanning your existing events so you\'ll know what to expect from the migration process. You can keep using your site and managing events. Check back later for the next step of migration.'=>'Skanujemy Twoje istniejące wydarzenia, abyś wiedział, czego możesz się spodziewać po procesie migracji. Możesz nadal korzystać ze swojej witryny i zarządzać wydarzeniami. Sprawdź później, aby poznać kolejny etap migracji.','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Twój system nie pozwala nam uruchomić podglądu, ale nadal możesz spróbować migracji. Podczas migracji %1$snie będziesz mógł tworzyć, edytować ani zarządzać swoimi wydarzeniami.%2$s Twój kalendarz nadal będzie widoczny w Twojej witrynie.','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Podgląd migracji jest gotowy i gotowy do przejrzenia. Nie wprowadzono żadnych zmian w Twoich wydarzeniach, ale ten raport pokazuje, jakie zmiany zostaną wprowadzone podczas migracji do nowego systemu. Jeśli masz jakieś pytania, %1$sskontaktuj się z naszym zespołem wsparcia%2$s.','We\'ve completely revamped the way event information is stored on your site\'s database. Upgrade now to take advantage of faster calendar load times and improved performance. As with any significant site change, we recommend %screating a site backup%s before beginning the migration process.'=>'Całkowicie odnowiliśmy sposób przechowywania informacji o wydarzeniach w bazie danych Twojej witryny. Zaktualizuj teraz, aby skorzystać z szybszych czasów ładowania kalendarza i lepszej wydajności. Podobnie jak w przypadku każdej znaczącej zmiany witryny, zalecamy %sutworzenie kopii zapasowej witryny%s przed rozpoczęciem procesu migracji.','unknown'=>'nieznany','Resources'=>'Zasoby','Plugins Page'=>'Strona wtyczek','Show more upcoming %1$s'=>'Pokaż więcej nadchodzących %1$s','Get ready for the new recurring events!'=>'Przygotuj się na nowe cykliczne wydarzenia!','Re-run preview'=>'Ponowne uruchomienie podglądu','Show past %1$s'=>'Pokaż ostatnie %1$s','The Events Calendar product suite logo'=>'Logo pakietu produktów Kalendarz wydarzeń','To safely cancel the migration, we need to reverse the process on any data that has already been modified. Your site will remain in maintenance mode until we have safely reversed the process.'=>'Aby bezpiecznie anulować migrację, musimy cofnąć proces dla wszystkich danych, które zostały już zmodyfikowane. Twoja witryna pozostanie w trybie konserwacji, dopóki bezpiecznie nie cofniemy procesu.','Upgrade FAQ'=>'Często zadawane pytania dotyczące aktualizacji','Upgrade your event data storage system.'=>'Zaktualizuj swój system przechowywania danych o wydarzeniach.','Version Compatibility'=>'Zgodność wersji','Upgrade is not Available'=>'Aktualizacja nie jest dostępna','Are you sure you want to reverse the recurring event system migration process?

- You will no longer be able to use the new recurring event and Series features.
- All event edits you have made since migration will be lost.
- As with migration, you will not be able to edit events or calendar options during this process and some frontend actions will be paused.
- Reverse migration should take less time than the original migration, but there is no time estimate available.
'=>'Czy na pewno chcesz cofnąć proces migracji systemu zdarzeń cyklicznych?

- Nie będziesz już mógł korzystać z nowych funkcji zdarzeń cyklicznych i serii.
- Wszystkie edycje zdarzeń wprowadzone od czasu migracji zostaną utracone.
- Podobnie jak w przypadku migracji, nie będziesz mógł edytować zdarzeń ani opcji kalendarza podczas tego procesu, a niektóre działania front-endu zostaną wstrzymane.
- Migracja odwrotna powinna zająć mniej czasu niż pierwotna migracja, ale nie ma szacunkowego czasu.
