g!'=>'Coś poszło nie tak!','Label for option to leave transparent (default).Transparent.'=>'Przezroczysty.','The event title color setting label.Event Date and Time'=>'Data i godzina wydarzenia','Label for option to set a custom color.Select Custom Color'=>'Wybierz niestandardowy kolor','Options selected here will override what was selected in the "Global Elements" section on Single Event views.'=>'Opcje wybrane w tym miejscu zastąpią opcje wybrane w sekcji „Elementy globalne” w widokach pojedynczego zdarzenia.','A link telling users to disable an extension that may conflict.You are using the Inherit Theme Fonts extension. Font control is now built into %1$sThe Events Calendar\'s options in the WordPress Customizer.%2$s Please disable the Inherit Theme Fonts extension to prevent conflicts with The Events Calendar.'=>'Używasz rozszerzenia Inherit Theme Fonts. Kontrola czcionek jest teraz wbudowana w opcje %1$sThe Events Calendar w WordPress Customizer.%2$s Wyłącz rozszerzenie Inherit Theme Fonts, aby zapobiec konfliktom z The Events Calendar.','The description for the base font size setting.Choose a base font size. Event text will scale around the selected base size.'=>'Wybierz podstawowy rozmiar czcionki. Tekst wydarzenia będzie skalowany wokół wybranego rozmiaru podstawowego.','The description for the event date and time color setting.Main date and time display on views and single event pages'=>'Główny wyświetlacz daty i godziny na widokach i stronach pojedynczych zdarzeń','The event accent color setting label.Accent Color'=>'Kolor akcentowy','The font size selector setting label.By Scale'=>'Według skali','Set Font Size'=>'Ustaw wielkość liter','Label for option to use default TEC fonts.Default'=>'Domyślna','The event title color setting label.Event Title'=>'Nazwa wydarzenia','Label for option to use theme fonts.Inherit theme font(s)'=>'Dziedzicz kroje pisma motywu','The base font size input setting label.By Pixel'=>'Wg Pixel','The link color setting label.Link Color'=>'Kolor odnośnika','Select Font Family'=>'Wybierz rodzinę kroju pisma','The Events Bar background color setting label.Background Color'=>'Kolor tła','The Events Bar border color setting label.Border Color'=>'Kolor obramowania','The events bar text color setting label.Text Color'=>'Kolor tekstu','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Z łatwością uzupełnij swój kalendarz wydarzeniami z serwisów Meetup, Eventbrite, iCal, Kalendarza Google i innych.','Events Aggregator'=>'Agregator wydarzeń','Events Bar'=>'Pasek wydarzeń','Import events with ease'=>'Łatwe importowanie wydarzeń','Label for option to use the accent color (default). Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Użyj <a href="%1$s">koloru akcentującego</a>','Label for option to use the accent color. Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Użyj <a href="%1$s">koloru akcentującego</a>','Label for option to use the event background color. Links to the event background color setting.Use the <a href="%1$s">General Background Color</a>'=>'Użyj <a href="%1$s">ogólnego koloru tła</a>','Label for option to use the events background color. Links to the background color setting.Use the Calendar <a href="%1$s">Background Color</a>'=>'Użyj <a href="%1$s">koloru tła</a> kalendarza','Note about what these settings control.These settings control the search and options bar that appears above calendar views.'=>'Ustawienia te kontrolują pasek wyszukiwania i opcji, który pojawia się nad widokiem kalendarza.','The header for the color control section.Adjust Appearance'=>'Dostosuj wygląd','The Events Calendar, Event Tickets and their add-ons integrate with other online tools and services to bring you additional features. Use the settings below to connect to third-party APIs and manage your integrations.'=>'Kalendarz wydarzeń, bilety na wydarzenia i ich dodatki integrują 