iCal, Kalendarza Google i innych.','My calendar doesn’t look right.'=>'Mój kalendarz nie wygląda poprawnie.','There are a few %s to resolve and prevent 404 errors.'=>'Istnieje kilka %s sposobów rozwiązania i zapobiegania błędom 404.','This can happen when other plugins try to improve performance. %s.'=>'Może się tak zdarzyć, gdy inne wtyczki próbują poprawić wydajność. %s.','Check for updates'=>'Sprawdź aktualizacje','Common Error Messages'=>'Typowe komunikaty o błędach','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be compromised if your site is running outdated or mis-matched versions.'=>'Ważne jest, aby korzystać z najnowszych wersji naszych wtyczek, aby mieć dostęp do najnowszych funkcji, poprawek błędów i aktualizacji zabezpieczeń. Funkcjonalność wtyczek może być zagrożona, jeśli Twoja witryna działa na przestarzałych lub niedopasowanych wersjach.','Enter a custom API key'=>'Wprowadź niestandardowy klucz API','Plugin(s) are out of date'=>'Wtyczki są nieaktualne','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'Kalendarz wydarzeń zawiera klucz API do podstawowej funkcjonalności map. Jeśli chcesz korzystać z bardziej zaawansowanych funkcji, takich jak niestandardowe znaczniki mapy, dynamiczne ładowanie map lub wyszukiwanie lokalizacji w Kalendarzu wydarzeń Pro i zaawansowany widok mapy, musisz uzyskać własny klucz API Map Google i dodać go do Wydarzenia &gt; Ustawienia &gt; Integracje','Default Google Maps API key'=>'Domyślny klucz API Google Maps','Manage your licenses'=>'Zarządzaj swoimi licencjami','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Klucze licencyjne można używać tylko na ograniczonej liczbie witryn, która różni się w zależności od poziomu licencji. Musisz usunąć licencję z jednej lub więcej innych witryn, aby użyć jej na tej.','Adjust your timezone'=>'Dostosuj swoją strefę czasową','Install max has been reached'=>'Osiągnięto maksymalną liczbę instalacji','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Podczas korzystania z Kalendarza wydarzeń zdecydowanie zalecamy korzystanie z geograficznej strefy czasowej, takiej jak „America/Los_Angeles” i unikanie przesunięcia strefy czasowej UTC, takiego jak „UTC+9”. Wybór strefy czasowej UTC dla witryny lub poszczególnych wydarzeń może powodować problemy podczas importowania wydarzeń lub z czasem letnim. Przejdź do ogólnych ustawień WordPress, aby dostosować strefę czasową witryny.','Display Custom HTML'=>'Wyświetl niestandardowy kod HTML','Hide Others’ Organizers and Venues'=>'Ukryj organizatorów i miejsca innych','Site time zone uses UTC'=>'Strefa czasowa witryny używa UTC','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'To rozszerzenie dodaje pola wyboru „Pokaż Mapy Google” i „Pokaż link do Map Google” podczas tworzenia nowego miejsca.','This extension allows you to add custom HTML content to the top of the Community submission form.'=>'To rozszerzenie umożliwia dodanie niestandardowej zawartości HTML na górze formularza zgłoszeniowego społeczności.','This extension allows you to hide the Organizers and Venues that a visitor has not