ent organizers whenever a user registers for their event.'=>'To rozszerzenie wyśle wiadomość e-mail do organizatorów wydarzeń za każdym razem, gdy użytkownik zarejestruje się na wydarzenie.','Ticket Email Settings'=>'Ustawienia e-maila z biletem','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'Przygotowaliśmy samouczek wideo pokazujący, jak tworzyć wydarzenia z Tickets przy użyciu naszych wtyczek. Kliknij link w linku w tytule, aby dowiedzieć się więcej.','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'W przypadku biletów opłaconych, zwrot środków można zrealizować za pośrednictwem używanej platformy e-commerce.','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Tak! Możesz łatwo wykonać to zadanie, korzystając z opcji stockowych i wielu typów biletów dostępnych w Event Tickets.','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Możesz sprzedawać bilety, korzystając z naszej wbudowanej opcji handlu elektronicznego lub dokonać uaktualnienia do wersji Event Tickets Plus, aby korzystać z wtyczek do handlu elektronicznego, np. WooCommerce.','How Do I create events with Tickets or RSVP’s?'=>'Jak tworzyć wydarzenia przy użyciu biletów lub potwierdzeń obecności?','Can I have more than one calendar?'=>'Czy mogę używać więcej niż jednego kalendarza?','Alternative photo view'=>'Alternatywny widok zdjęcia','Help page?'=>'Strona pomocy?','* Your system information will only be used by The Events Calendar support team. All information is stored securely. We do not share this information with any third parties.'=>'* Informacje o Twoim systemie będą wykorzystywane wyłącznie przez zespół wsparcia The Events Calendar. Wszystkie informacje są przechowywane