adzieję, że pokochasz %1$s','Authorize Promoter'=>'Autoryzuj promotora','Licenses for Multisites'=>'Licencje dla Multisites','Please authorize to continue onboarding.'=>'Proszę o autoryzację kontynuacji rejestracji.','Promoter would like to sync with your site'=>'Promotor chciałby zsynchronizować się z Twoją witryną','Sorry, unable to authenticate your site. Please contact Promoter support.'=>'Przepraszamy, nie można uwierzytelnić Twojej witryny. Skontaktuj się z pomocą techniczną Promoter.','Why am I being told my license key is out of installs?'=>'Dlaczego wyświetla mi się komunikat, że mój klucz licencyjny jest niedostępny?','You do not have access to authenticate this site.'=>'Nie masz uprawnień do uwierzytelnienia tej witryny.','The associated field is required.( required )'=>'( wymagany )','In order to register a plugin license, you\'ll first need to %1$sdownload and install%2$s the plugin you purchased. You can download the latest version of your plugin(s) from %3$syour account\'s downloads page%4$s. Once the plugin is installed and activated on this site, the license key field will appear below.'=>'Aby zarejestrować licencję wtyczki, musisz najpierw %1$spobrać i zainstalować%2$s zakupioną wtyczkę. Możesz pobrać najnowszą wersję wtyczki(wtyczek) ze strony pobierania %3$s swojego konta%4$s. Po zainstalowaniu i aktywowaniu wtyczki na tej stronie pole klucza licencyjnego pojawi się poniżej.','North Macedonia'=>'Macedonia Północna','Compact date format'=>'Kompaktowy format daty','Select the date format used for elements with minimal space, such as in datepickers.'=>'Wybierz format daty używany w elementach z małą ilością miejsca, np. w selektorach dat.','If you\'ve purchased a premium add-on, you\'ll need to enter your license key here in order to have access to automatic updates when new versions are available.'=>'Jeśli kupiłeś dodatek premium, musisz wprowadzić tutaj swój klucz licencyjny, aby uzyskać dostęp do automatycznych aktualizacji, gdy tylko pojawią się nowe wersje.','Action-based Logger'=>'Rejestrator oparty na działaniach','The Action Logger will dispatch any logging message using the "tribe_log" action writing, by default, to the PHP error log.'=>'Action Logger domyślnie wysyła wszelkie komunikaty dziennika do dziennika błędów PHP, korzystając z akcji „tribe_log”.','There’s a new version of %1$s available, but your license is expired. You’ll need to renew your license to get access to the latest version. If you plan to continue using your current version of the plugin(s), be sure to use a compatible version of The Events Calendar. %2$s'=>'Dostępna jest nowa wersja %1$s, ale Twoja licencja wygasła. Musisz odnowić licencję, aby uzyskać dostęp do najnowszej wersji. Jeśli planujesz nadal używać obecnej wersji wtyczki(wtyczek), upewnij się, że używasz zgodnej wersji The Events Calendar. %2$s','Promoter'=>'Promotor','Confirm'=>'Potwierdź','Close this dialog window'=>'Zamknij to okno dialogowe','Open the modal window'=>'Otwórz okno modalne','Key'=>'Klucz','Value'=>'Wartość','PHP Render Context'=>'Kontekst Renderowania w PHP','Reads'=>'Odczyty','Writes'=>'Zapisy','OK'=>'OK','Close this modal window'=>'Zamknij to okno modalne','Open the dialog window'=>'Otwórz okno dialogowe','%s must be a valid URL.'=>'%s musi być poprawnym URL-em.','Could not delete post with ID '=>'Nie można usunąć posta z ID ','ORM arg'=>'Argument ORM','Your update failed due to an incompatibility between the version (%1$s) of the %2$s you tried to update to and the version of %3$s that you are using. %4$s'=>'Aktualizacja nie powiodła się z powodu niezgodności między wersją (%1$s) %2$s, do której próbowałeś dokonać aktualizacji, a wersją %3$s, której używasz. %4$s','Read more.'=>'Dowiedz się więcej.','State'=>'Województwo','Event Date & Time'=>'Data i godzina wydarzenia','Show Timezone'=>'Pokaż strefę czasową','Event Venue'=>'Miejsce wydarzenia','Event Organizer'=>'Organizator wydarzenia','Event Categories'=>'Kategorie wydarzeń','Tags'=>'Znaczniki','%s ago'=>'%s temu','Show Map'=>'Pokaż mapę','Show Map:'=>'Pokaż mapę:','Add Description...'=>'Dodaj opis...','Add Button Text'=>'Dodaj tekst przycisku','Event Organizers'=>'Organizatorzy wydarzeń','Unknown Column '=>'Nieznana kolumna ','There was an error building the record queue: '=>'Podczas budowania kolejki rekordów wystąpił błąd: ','%s from now'=>'%s od teraz','Text Array'=>'Tablica tekstowa','Numeric Array'=>'Tablica numeryczna','All day'=>'Cały dzień','Enable Maps'=>'Włącz Mapy','g:i a'=>'g:i a','Event Blocks'=>'Bloki wydarzeń','Problem loading the block, please remove this block to restart.'=>'Problem z wczytywaniem bloku, proszę usunąć ten blok, aby ponownie uruchomić.','F j, Y'=>'F j, Y','F j'=>'F j','Show Map Link'=>'Pokaż odnośnik mapy','(click here for details)'=>'(kliknij tutaj po szczegóły)','Activate Block Editor for Events'=>'Włącz Edytor bloku dla wydarzeń','Show Map Link:'=>'Pokaż odnośnik mapy :','Show Custom Fields metabox'=>'Pokaż metabox Własne Pola','If you want to stop and clear current asynchronous import processes %1$s.'=>'Jeśli chcesz zatrzymać i wyczyścić bieżące asynchroniczne procesy importu %1$s.','Import Process System'=>'Importuj proces systemowy','Stop current processes'=>'Zatrzymaj bieżący proces','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Proces importu asynchronicznego jest szybszy i nie opiera się na WordPressie Cron, ale może nie działać poprawnie we wszystkich instalacjach WordPress, spróbuj przełączyć się na proces oparty na Cronie, aby uzyskać maksymalną kompatybilność.','click here'=>'kliknij tutaj','to create your own free Google Maps API key.'=>'aby utworzyć swój własny darmowy klucz Google Maps API.','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Jeśli nie dodasz własnego klucza API, wbudowany klucz API zawsze zapełni to pole, a niektóre funkcje związane z mapami będą ograniczone ','<p>The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %1$sGoogle Maps API key</a>. %2$sRead More</a>.</p>'=>'<p>Kalendarz wydarzeń zawiera klucz API do podstawowej funkcjonalności map. Jeśli chcesz korzystać z bardziej zaawansowanych funkcji, takich jak niestandardowe znaczniki mapy lub dynamiczne ładowanie map, musisz uzyskać własny %1$sklucz API Map Google</a>. %3$sCzytaj więcej</a>.</p>','Import from Eventbrite URL'=>'Importuj z adresu URL Eventbrite','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Używasz wbudowanego klucza Google Maps API dla Kalendarza wydarzeń.','Asynchronous'=>'Asynchroniczny','Cron-based'=>'Oparte na Cron','No asynchronous queue processes to clear.'=>'Brak procesów kolejki asynchronicznej do wyczyszczenia.','Unsupported'=>'Niewspierane','You are using a custom Google Maps API key.'=>'Używasz własnego klucza Google Maps API.','Successfully stopped and cleared 1 asynchronous queue process.'=>'Pomyślnie zatrzymano i wyczyszczono 1 asynchroniczny proces kolejki.' . "\0" . 'Pomyślnie zatrzymano i wyczyszczono %d asynchroniczne procesy kolejki.' . "\0" . 'Pomyślnie zatrzymano i wyczyszczono %d asynchronicznych procesów kolejki.','to learn more about using it with The Events Calendar'=>'aby dowiedzieć się więcej o używaniu go z Kalendarzem wydarzeń','Unable to process this import - a breakage or conflict may have resulted in the import halting.'=>'Nie można przetworzyć tego importu. Import mógł zostać zatrzymany z powodu awarii lub konfliktu.','The event category ID or name'=>'Identyfikator lub nazwa kategorii wydarzenia','The event tag ID or name'=>'Identyfikator lub nazwa tagu wydarzenia','Events should be filtered by their post_parent being the specified one.'=>'Wydarzenia powinny być filtrowane według ich parametru post_parent, czyli określonego.','Include events with one of the post IDs specified in the array of CSV list, date filters will be ignored.'=>'Uwzględnij wydarzenia z jednym z identyfikatorów wpisów określonych w tablicy listy CSV; filtry dat zostaną zignorowane.','Calendar of %s'=>'Kalendarz %s','%s Search and Views Navigation'=>'%s Nawigacja po wyszukiwaniu i widokach','If you have extended our plugin(s) to send data to a third-party service such as Eventbrite, Google Maps, or PayPal, user information may be passed to these external services. These services may be located abroad.'=>'Jeśli rozszerzyłeś nasze wtyczki, aby wysyłać dane do usług zewnętrznych, takich jak Eventbrite, Google Maps lub PayPal, informacje o użytkowniku mogą zostać przekazane tym zewnętrznym usługom. Usługi te mogą znajdować się za granicą.','%s Views Navigation'=>'%s Widoki nawigacja','Where We Send Your Data'=>'Gdzie wysyłamy Twoje dane','Certain data may be exported or removed upon users’ requests via the existing Exporter or Eraser. Please note, however, that several “edge cases” exist in which we are unable to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Niektóre dane mogą zostać wyeksportowane lub usunięte na żądanie użytkowników za pośrednictwem istniejącego Exportera lub Erasera. Należy jednak pamiętać, że istnieje kilka „przypadków skrajnych”, w których nie jesteśmy w stanie udoskonalić gromadzenia i eksportowania wszystkich danych dla użytkowników końcowych. Sugerujemy przeprowadzenie wyszukiwania w lokalnej bazie danych, a także w Panelu WordPressa, aby zidentyfikować wszystkie dane zebrane i przechowywane na potrzeby konkretnych żądań użytkowników.','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Wszystkie informacje (dane) są przechowywane w lokalnej bazie danych na czas nieokreślony, o ile nie zostaną usunięte.','We make use of certain APIs, in order to provide specific features.'=>'Korzystamy z niektórych interfejsów API w celu zapewnienia określonych funkcji.','How Long You Retain this Data'=>'Jak długo są przechowywane te dane','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'Pakiet Kalendarz wydarzeń oferuje korzystanie z kluczy API stron trzecich. Główne funkcje to udoskonalenie wbudowanych przez nas funkcji, z których niektóre korzystają z Map Google, PayPal, Eventbrite i Meetup. Te klucze API nie są dostarczane przez Kalendarz wydarzeń.','API Keys'=>'Klucze API','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Należy pamiętać, że aby tworzyć nowe wydarzenia za pośrednictwem formularza przesyłania wydarzeń społecznościowych, użytkownik musi posiadać konto w tej domenie. Informacje te są przechowywane w lokalnej bazie danych. Istnieje również możliwość anonimowego tworzenia wydarzeń, jeśli właściciel witryny ma włączoną tę opcję.','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'Podczas zakupu biletów Eventbrite informacje o uczestnikach, kupujących i zamówieniach są przechowywane i zarządzane przez Eventbrite.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Informacje o biletach Eventbrite: nazwa, opis, koszt, typ, ilość','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Importuj dane źródłowe (adres URL, z którego importowane są wydarzenia, np. Eventbrite, MeetUp, inne zgodne źródła adresów URL i inne, które mogą zawierać podobne lub takie same dane, jak wymienione powyżej)','Importing Events, Venues, and Organizers:'=>'Importowanie wydarzeń, miejsc i organizatorów:','Suggested text:'=>'Sugerowany tekst:','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Informacje o miejscu: nazwa, adres, miasto, kraj, stan, kod pocztowy, telefon, strona internetowa, współrzędne geograficzne (szerokość i długość geograficzna)','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Wszystkie dane zawarte w pliku CSV lub ICS oraz zewnętrzne adresy URL (dla wydarzeń, miejsc, organizatorów i biletów)','Event information: website, cost, description, date, time, image'=>'Informacje o zdarzeniu: strona internetowa, koszt, opis, data, godzina, zdjęcie','Organizer information: name, phone, website, email'=>'Informacje o organizatorze: imię i nazwisko, telefon, strona internetowa, e-mail','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within your website’s database.'=>'Za pośrednictwem wtyczek The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets i Community Events, a także naszej usługi Event Aggregator Import (zawartej we wtyczce The Events Calendar) można zbierać informacje i przechowywać je w bazie danych Twojej witryny.','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Jeśli tworzysz, dodajesz, importujesz, zapisujesz bądź publikujesz informacje o wydarzeniu, miejscu lub organizatorze, takie informacje są zachowywane w lokalnej bazie danych:','Import from Eventbrite'=>'Importuj z Eventbrite','Learn more'=>'Dowiedz się więcej','Disclaimer:'=>'Zastrzeżenie:','An event having a post meta value of `%s` hour (12-hour) is not valid. Make sure it is from 1 to 12.'=>'Wydarzenie mające wartość post meta równą `%s` hour (12-hour) jest nieprawidłowe. Upewnij się, że jest to wartość od 1 do 12.','An event having a post meta value of `%s` hour (24-hour) is not valid. Make sure it is from 0 to 23.'=>'Wydarzenie mające wartość post meta równą `%s` hour (24-godzinna) jest nieprawidłowe. Upewnij się, że jest to wartość od 0 do 23.','An event having a post meta value of `%s` hour (am/pm) is not valid. Make sure it is from 1 to 12.'=>'Wydarzenie mające wartość post meta równą `%s` hour (am/pm) jest nieprawidłowe. Upewnij się, że jest to od 1 do 12.','An event having a post meta value of `%s` meridian is not valid. Make sure it is either `am` or `pm`, or remove it entirely if using the 24-hour format.'=>'Wydarzenie mające wartość post meta wynoszącą `%s` meridian jest nieprawidłowe. Upewnij się, że jest to `am` lub `pm`, lub usuń je całkowicie, jeśli używasz formatu 24-godzinnego.','An event having a post meta value of `%s` minutes is not valid. Make sure it is from 0 to 59.'=>'Wydarzenie mające wartość post meta wynoszącą `%s` minutes nie jest prawidłowe. Upewnij się, że jest to od 0 do 59.','Do more with Eventbrite Tickets'=>'Zrób więcej dzięki biletom Eventbrite','Eventbrite Import Settings'=>'Ustawienia importu Eventbrite','The default event category for events imported via Eventbrite'=>'Domyślna kategoria zdarzeń dla zdarzeń importowanych za pośrednictwem Eventbrite','The default post status for events imported via Eventbrite'=>'Domyślny status posta dla wydarzeń importowanych za pośrednictwem Eventbrite','This information is only for guidance and not to be considered as legal advice.'=>'Informacje te stanowią jedynie wskazówki i nie należy ich uważać za poradę prawną.','This information serves as a guide on what sections need to be modified due to usage of The Events Calendar and its Add-ons.'=>'Informacje te stanowią przewodnik po sekcjach, które należy zmodyfikować ze względu na korzystanie z Kalendarza wydarzeń i jego dodatków.','What personal data we collect and why we collect it'=>'Jakie dane osobowe zbieramy i dlaczego je zbieramy','You should include the information below in the correct sections of you privacy policy.'=>'Poniższe informacje należy umieścić w odpowiednich sekcjach polityki prywatności.','Event, Venue, and Organizer Information'=>'Informacje o Wydarzeniu, Miejscu i Organizatorze','Hello,'=>'Witaj,','None'=>'Brak','Settings > General'=>'Ustawienia > Ogólne','timezone settings'=>'ustawienia strefy czasowej','Select Source'=>'Wybierz źródło','Log into Eventbrite'=>'Zaloguj się do Eventbrite','Connect to Eventbrite'=>'Połącz się z Eventbrite','Invalid Eventbrite URL'=>'Nieprawidłowy adres URL Eventbrite','Events will be imported with the same timezone as defined on eventbrite.com. You can make use of The Events Calendar\'s'=>'Wydarzenia zostaną zaimportowane z tą samą strefą czasową, która została zdefiniowana na eventbrite.com. Możesz skorzystać z kalendarza wydarzeń','Import events directly from your connected Eventbrite.com account or from a public Eventbrite.com URL.'=>'Importuj wydarzenia bezpośrednio ze swojego połączonego konta Eventbrite.com lub z publicznego adresu URL Eventbrite.com.','Limited connectivity with Eventbrite'=>'Ograniczona łączność z Eventbrite','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Eventbrite on a set schedule. Single events can be added via a one-time import.'=>'Jednorazowe importy obejmują wszystkie aktualnie wymienione wydarzenia, podczas gdy zaplanowane importy automatycznie pobierają nowe wydarzenia i aktualizacje z Eventbrite według ustalonego harmonogramu. Pojedyncze wydarzenia można dodać za pomocą jednorazowego importu.','The number of events available in the preview may be limited by your %1$sImport Settings.%2$s'=>'Liczba zdarzeń dostępnych w podglądzie może być ograniczona przez %1$sUstawienia importu.%2$s','Use the filters to narrow down which events are fetched from Eventbrite.'=>'Użyj filtrów, aby zawęzić listę wydarzeń pobieranych z Eventbrite.','You have not connected Event Aggregator to Eventbrite'=>'Nie połączyłeś Event Aggregator z Eventbrite','to change how the actual time is displayed on your calendar.'=>'aby zmienić sposób wyświetlania aktualnego czasu w kalendarzu.','Import from your Eventbrite account'=>'Importuj ze swojego konta na Eventbrite','Invalid Facebook URL'=>'Błędny adres URL Facebook','Invalid Meetup URL'=>'Błędny adres URL Meetup','Please log in to enable event imports from Eventbrite.'=>'Zaloguj się, aby umożliwić import zdarzeń z Eventbrite.','Refresh your connection to Eventbrite'=>'Odśwież połączenie z Eventbrite','eventbrite.com/e/example-12345'=>'eventbrite.com/e/przyklad-12345','link for connecting eventbriteConnect to Eventbrite'=>'Połącz z Eventbrite','Import Source'=>'Źródło importu','You need to connect to Eventbrite for Event Aggregator to work properly'=>'Aby Agregator wydarzeń działał prawidłowo, musisz połączyć się z Eventbrite','No upcoming Eventbrite events found.'=>'Nie znaleziono nadchodzących wydarzeń Eventbrite.','Successfully fetched Eventbrite Token'=>'Pomyślnie pobrano token Eventbrite','Events cannot be imported because Eventbrite has returned an error. This could mean that the event ID does not exist, the event or source is marked as Private, or the event or source has been otherwise restricted by Eventbrite. You can <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">read more about Eventbrite restrictions in our knowledgebase</a>.'=>'Nie można zaimportować zdarzeń, ponieważ Eventbrite zwrócił błąd. Może to oznaczać, że identyfikator zdarzenia nie istnieje, zdarzenie lub źródło jest oznaczone jako prywatne lub zdarzenie lub źródło zostało w inny sposób ograniczone przez Eventbrite. <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">Więcej informacji na temat ograniczeń Eventbrite można znaleźć w naszej bazie wiedzy</a> .','Please provide a Eventbrite URL when importing from Eventbrite.'=>'Podaj adres URL Eventbrite podczas importowania z Eventbrite.','The current status of the import.'=>'Aktualny stan importu.','The current interval, in seconds, between the end of a batch process and the start of the next; as set on the server.'=>'Aktualny interwał (w sekundach) między końcem jednego procesu wsadowego a początkiem następnego; ustawiony na serwerze.','The hash of the next expected batch, as previously provided by the client'=>'Skrót kolejnej oczekiwanej partii, wcześniej podany przez klienta','The new status message for the user, not localized.'=>'Nowy komunikat o stanie dla użytkownika, nielokalizowany.','The new status message slug, to allow for localized messages.'=>'Nowy ślimak komunikatu o stanie umożliwiający lokalizację komunikatów.','The percentage of import completed.'=>'Procent ukończonego importu.','2018 user survey<strong>The Events Calendar Annual Survey:</strong> share your feedback with our team—%1$s!'=>'<strong>Roczna ankieta dotycząca kalendarza wydarzeń:</strong> podziel się swoją opinią z naszym zespołem — %1$s!','Read more'=>'Dowiedz się więcej','The new status of the import.'=>'Nowy stan importu.','There is an JSON error with the Event Aggregator server. Please try your import again later.'=>'Wystąpił błąd JSON na serwerze Agregatora wydarzeń. Spróbuj ponownie wykonać import później.','The import unique ID as provided by Event Aggregator service'=>'Unikatowy identyfikator importu dostarczony przez usługę Agregator wyda