rzeń dla wydarzeń importowanych za pośrednictwem Meetup','You can make changes to imported events via The Events Calendar and see those changes reflected on your site’s calendar. The owner of the original event source (e.g. the iCalendar feed or Meetup group) might also make changes to their event. If you choose to re-import an altered event (manually or via a scheduled import), any changes made at the source or on your calendar will need to be addressed.'=>'Możesz wprowadzać zmiany w importowanych wydarzeniach za pośrednictwem Kalendarza wydarzeń i zobaczyć te zmiany odzwierciedlone w kalendarzu Twojej witryny. Właściciel oryginalnego źródła wydarzenia (np. kanał iCalendar lub grupa Meetup) może również wprowadzać zmiany w swoim wydarzeniu. Jeśli zdecydujesz się ponownie zaimportować zmienione wydarzenie (ręcznie lub za pośrednictwem zaplanowanego importu), wszelkie zmiany wprowadzone w źródle lub w kalendarzu będą musiały zostać uwzględnione.','Default Event Category'=>'Domyślna kategoria wydarzeń','Default Status'=>'Domyślny status','Global Import Settings'=>'Wczytanie globalnych ustawień','The default event category for events'=>'Domyślna kategoria wydarzenia dla wydarzeń','The default post status for events'=>'Domyślny status wpisu dla wydarzeń','To import Meetup events, please be sure to add your Meetup API key on %1$sEvents > Settings > Integrations%2$s'=>'Aby zaimportować wydarzenia Meetup, pamiętaj o dodaniu klucza API Meetup w obszarze %1$sWydarzenia &gt; Ustawienia &gt; Integracje%2$s','iCalendar Import Settings'=>'iCalendar ustawienia importu','The default post status for events imported via .ics files'=>'Domyślny status wpisu dla wydarzeń importowanych za pomocą plików .ics','The default post status for events imported via CSV'=>'Domyślny status wpisu dla wydarzeń importowanych za pomocą pliku CSV','The default post status for events imported via Google Calendar'=>'Domyślny status wpisu dla wydarzeń importowanych za pomocą Kalendarza Google','The defaul