talog powinien znajdować się w katalogu „common/” wtyczki kalendarza wydarzeń.','Keep the Core Plugin %sFREE%s!'=>'Zachowaj wtyczkę główną %sFREE%s!','Without a defined location your event will not display a %sGoogle Rich Snippet%s on the search results.'=>'Jeśli nie zdefiniowano lokalizacji, Twoje wydarzenie nie będzie wyświetlane jako %sfragment rozszerzony Google%s w wynikach wyszukiwania.','%1$s scheduled for: %2$s.'=>'%1$s zaplanowano dla: %2$s.','%1$s scheduled for: %2$s. %3$sPreview %4$s'=>'%1$s zaplanowano dla: %2$s. %3$sPodgląd %4$s','Next Day'=>'Następny dzień','No results were found for %1$s in or near %2$s.'=>'Nie znaleziono żadnych wyników dla %1$s w lub w pobliżu %2$s.','There were no results found for %s.'=>'Nie znaleziono żadnych wyników dla %s.','Check out the %savailable add-ons%s.'=>'Sprawdź %sdostępne dodatki%s.','%1$s draft updated. %2$sPreview %3$s'=>'%1$s zaktualizowano szkic. %2$sPodgląd %3$s','If you have tried the above steps and are still having trouble, you can post a new thread to our %s. Our support staff monitors these forums once a week and would be happy to assist you there.'=>'Jeśli wypróbowałeś powyższe kroki i nadal masz problemy, możesz opublikować nowy wątek na naszym %s. Nasz personel wsparcia monitoruje te fora raz w tygodniu i chętnie ci pomoże.','open-source forum on WordPress.org'=>'forum open-source na WordPress.org','post a thread'=>'załóż wątek','<strong>Looking for more immediate support?</strong> We offer %1$s with the purchase of any of our premium plugins (like %2$s). Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays.'=>'<strong>Potrzebujesz bardziej natychmiastowego wsparcia?</strong> Oferujemy %1$s przy zakupie dowolnej z naszych wtyczek premium (takich jak %2$s). Kup licencję i możesz tam bezpośrednio publikować posty, a otrzymasz odpowiedź w ciągu 24-48 godzin w dni robocze.','<strong>Looking for more immediate support?</strong> We offer %s with the purchase of any of our premium plugins. Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays'=>'<strong>Potrzebujesz bardziej natychmiastowej pomocy?</strong> Oferujemy %s przy zakupie dowolnej z naszych wtyczek premium. Kup licencję i możesz tam bezpośrednio publikować posty, oczekując odpowiedzi w ciągu 24-48 godzin w dni robocze','%s: An overview of the default templates and styles that are included in the plugin, as well as how to change them.'=>'%s: Przegląd domyślnych szablonów i stylów zawartych we wtyczce, a także sposób ich zmiany.','%s: Code and guides for customizing your calendar in useful and interesting ways.'=>'%s: Kod i przewodniki dotyczące dostosowywania kalendarza w użyteczny i interesujący sposób.','If you have tried the above steps and are still having trouble, you can post a new thread to our WordPress.org forums for %1$s or %2$s. Our support staff monitors these forums once a week and would be happy to assist you there. '=>'Jeśli wypróbowałeś powyższe kroki i nadal masz problemy, możesz opublikować nowy wątek na naszych forach WordPress.org dla %1$s lub %2$s. Nasz personel wsparcia monitoruje te fora raz w tygodniu i chętnie ci pomoże. ','Using stylesheets and page templates'=>'Korzystanie z arkuszy stylów i szablonów stron','premium support on our website'=>'wsparcie premium na naszej stronie internetowej','%s: Do you see an issue with your calendar? Go here first to find where it’s coming from and how to fix it.'=>'%s: Czy widzisz problem z kalendarzem? Przejdź tutaj, aby dowiedzieć się, skąd się bierze i jak go naprawić.','Events Tickets'=>'Bilety na wydarzenie','Troubleshooting common problems'=>'Rozwiązywanie popularnych problemów','Customizing the Events plugins'=>'Dostosowywanie wtyczek wydarzeń','Settings overview'=>'Przegląd ustawień','%s: A complete look at the features you can expect to see right out of the box as well as how to use them.'=>'%s: Pełny przegląd funkcji, których możesz spodziewać się zaraz po wyjęciu z pudełka, a także sposobu ich wykorzystania.','%s: A thorough walkthrough of The Events Calendar and the settings that are available to you.'=>'%s: Szczegółowy przewodnik po Kalendarzu wydarzeń i dostępnych ustawieniach.','%s: Our most comprehensive outline for customizing the calendar to suit your needs, including custom layouts and styles.'=>'%s: Nasz najbardziej kompleksowy plan dostosowania kalendarza do Twoich potrzeb, obejmujący niestandardowe układy i style.','Features overview'=>'Przegląd funkcji','New User Primer'=>'Podręcznik dla nowych użytkowników','We are committed to helping make your calendar spectacular and have a wealth of resources available, including a handy %s to get your calendar up and running.'=>'Zależy nam na tym, aby Twój kalendarz był spektakularny i oferujemy wiele zasobów, w tym przydatny %s, który pomoże Ci uruchomić kalendarz.','CSV Import Settings'=>'Ustawienia importu z plików CSV','Support for The Events Calendar'=>'Wsparcie dla Kalendarza wydarzeń','Clear'=>'Wyczyść','Unnamed %s'=>'Nienazwany %s','Add another %s'=>'Dodaj następne %s','Create New %s'=>'Utwórz nowy %s','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Należy pamiętać, że wszelkie praktyczne wsparcie jest świadczone za pośrednictwem helpdesku. Możesz wysłać do nas e-mail lub tweeta… ale prawdopodobnie przekierujemy Cię z powrotem do helpdesku 😄','Read more about our support policy'=>'Przeczytaj więcej o naszej polityce wsparcia','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Jest bardzo mało problemów, których nie widzieliśmy i prawdopodobnie inny użytkownik już zadał Twoje pytanie i otrzymał odpowiedź od naszego personelu wsparcia. Podczas gdy publikowanie w helpdesku jest dostępne tylko dla klientów płacących, każdy może je przeszukiwać i przeglądać.','Test for a theme or plugin conflict'=>'Testuj w celu wykrycia konfliktu z szablonem lub wtyczką','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Wszystkie typowe (i nie tak typowe) odpowiedzi na pytania, które widzimy, są tutaj. Często jest to najszybsza droga do znalezienia odpowiedzi!','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Testowanie istniejącego konfliktu jest najlepszym początkiem dogłębnego rozwiązywania problemów. Często prosimy o wykonanie tych kroków podczas otwierania nowego wątku, więc zrobienie tego z wyprzedzeniem będzie bardzo pomocne.','Check our Knowledgebase'=>'Sprawdź naszą bazę wiedzy','Knowledgebase'=>'Baza wiedzy','Getting More Help'=>'Uzyskiwanie dodatkowej pomocy','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'%s na naszej stronie internetowej to świetne miejsce, w którym znajdziesz porady i wskazówki dotyczące korzystania z naszych wtyczek i ich dostosowywania.','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Chociaż powyższe zasoby pomagają rozwiązać większość problemów, które widzimy, czasami możesz potrzebować dodatkowego wsparcia. Jeśli potrzebujesz pomocy w korzystaniu z naszych wtyczek i chcesz, abyśmy się im przyjrzeli, wykonaj następujące kroki:','list of available functions'=>'lista dostępnych funkcji','Getting Support'=>'Uzyskiwanie wsparcia','Thank you for using %s! All of us at The Events Cale