vents:'=>'Oto adres URL kanału iCal dla Twoich wydarzeń:','Hide From %s Listings'=>'Ukryj z %s aukcji','If you are familiar with HTML, you can add additional code after the event template. Some themes may require this to help with styling or layout.'=>'Jeśli znasz HTML, możesz dodać dodatkowy kod po szablonie wydarzenia. Niektóre motywy mogą tego wymagać, aby pomóc w stylizacji lub układzie.','If you are familiar with HTML, you can add additional code before the event template. Some themes may require this to help with styling or layout.'=>'Jeśli znasz HTML, możesz dodać dodatkowy kod przed szablonem wydarzenia. Niektóre motywy mogą tego wymagać, aby pomóc w stylizacji lub układzie.','Looking for additional functionality including recurring events, custom meta, community events, ticket sales and more?'=>'Szukasz dodatkowych funkcji, w tym wydarzeń cyklicznych, niestandardowych metadanych, wydarzeń społecznościowych, sprzedaży biletów i innych?','Only includes enough css to achieve complex layouts like calendar and week view.'=>'Zawiera wystarczającą ilość kodu CSS, aby uzyskać złożone układy, takie jak widok kalendarza i tygodnia.','Page template to control the appearance of your calendar and event content.'=>'Szablon strony umożliwiający kontrolowanie wyglądu kalendarza i zawartości wydarzeń.','When events are sticky in month view, they\'ll display first in the list of events shown within a given day block.'=>'Gdy wydarzenia są przypięte w widoku miesięcznym, będą wyświetlane w pierwszej kolejności na liście wydarzeń wyświetlanych w danym bloku dnia.','You are running Version %s and deserve a hug :-)'=>'Używasz wersji %s i zasługujesz na uścisk :-)','You have changed the recurrence rules of this %1$s.  Saving the %1$s will update all future %2$s.  If you did not mean to change all %2$s, then please refresh the page.'=>'Zmieniłeś reguły powtarzania tego %1$s. Zapisanie %1$s zaktualizuje wszystkie przyszłe %2$s. Jeśli nie chciałeś zmienić wszystkich %2$s, odśwież stronę.','Add to Google Calendar'=>'Dodaj do kalendarza Google','Check out the available add-ons.'=>'Sprawdź dostępne dodatki.','Check this to cache your month view HTML in transients, which can help improve calendar speed on sites with many events. <a href="%s" rel="noopener" target="_blank">Read more</a>.'=>'Zaznacz to, aby buforować swój miesięczny widok HTML w transjentach, co może pomóc w zwiększeniu szybkości kalendarza na stronach z wieloma wydarzeniami. <a href="%s" rel="noopener" target="_blank">Przeczytaj więcej</a> .','Community Events'=>'Wydarzenia społeczności','Date time separator'=>'Seperator dat','Default Events Template'=>'Domyślny szablon wydarzeń','Default view'=>'Domyślny widok','Edit'=>'Edytuj','Enable comments on event pages.'=>'Włącz komentarze na stronie wydarzenia.','Enable event views'=>'Włącz widok wydarzenia','Enter the separator that will be placed between the date and time, when both are shown.'=>'Wpisz separator oddzielający datę i godzinę, gdy obydwie są wyświetlane.','Enter the separator that will be used between the start and end time of an event.'=>'Wpisz separator oddzielający godzinę rozpoczęcia oraz godzinę zakończenia wydarzenia.','Events URL slug'=>'URL slug wydarzeń','Have an event that runs past midnight? Select a time after that event\'s end to avoid showing the event on the next day\'s calendar.'=>'Masz wydarzenie które kończy się po północy? Wybierz godzinę po zakończeniu tego wydarzenia aby uniknąć wyświetlania tego wydarzenia w następnym dniu.','Looking for Something Special?'=>'Szukasz czegoś specjalnego?','Month view events per day'=>'Liczba wydarzeń na dzień w widoku miesiąca','Number of events to show per page'=>'Liczba wydarzeń na stronę','Pro'=>'Pro','Show events with the site\'s other posts. When this box is checked, events will also continue to appear on the default events page.'=>'Pokazuj wydarzenia razem z innymi postami na stronie. Gdy ta opcja jest zaznaczona, wydarzenia będą również dalej pokazywać się na domy